(function($){"use strict";var windowOn=$(window);gsap.registerPlugin(ScrollTrigger);let mc=gsap.matchMedia();mc.add("(min-width: 1024px)",()=>{if(document.querySelector(".about2-tab")){let e=".about2-tab__wrap";if(!window.its_desktop)e=".about2-tab__left";const pinTarget=".about2-tab";window.aboutPinTime=1500;let t=gsap.timeline({scrollTrigger:{trigger:e,start:"center center",end:"+="+window.aboutPinTime+"px",pin:pinTarget,pinSpacing:!0,scrub:1,},});t.fromTo(".about2-tab__circle",{opacity:0},{opacity:1,duration:0.01},0).fromTo(".about2-tab__circles",{rotate:-120},{rotate:0,duration:3},0).fromTo(".about2-tab__circle--circle1",{yPercent:0},{yPercent:0,duration:3},0).fromTo(".about2-tab__circle--circle2",{yPercent:0,xPercent:0},{yPercent:0,xPercent:0,duration:3},0).fromTo(".about2-tab__circle--circle3",{yPercent:0,xPercent:0},{yPercent:0,xPercent:0,duration:3},0)
    gsap.to(".about2-tab__circles",{rotation:360,scrollTrigger:{trigger:".about2-tab__wrap",start:"top bottom",end:"bottom top",scrub:1,}});if(window.its_desktop){t.fromTo(".about2-tab__left",{x:"50%",background:"red"},{x:"0%",duration:1,delay:1.25,background:"green"},1)}
    const initMagnetHover=()=>{const magnets=document.querySelectorAll(".magnet-wrap");if(window.innerWidth>1024){magnets.forEach((wrap)=>{const area=wrap.querySelector(".magnet-area");const element=wrap.querySelector(".magnet-element");const cov=parseFloat(wrap.getAttribute("data-cov"))||4;if(area&&element){area.addEventListener("mousemove",(e)=>{const bounds=area.getBoundingClientRect();const x=e.clientX-bounds.left-bounds.width/2;const y=e.clientY-bounds.top-bounds.height/2;gsap.to(element,{x:x/cov,y:y/cov,duration:0.4,ease:"power2.out",})});area.addEventListener("mouseleave",()=>{gsap.to(element,{x:0,y:0,duration:0.7,ease:"power3.out",})})}})}};initMagnetHover()}})})(jQuery)